import styled from 'styled-components/native'
import * as BaseStyles from '../BaseStyles.js'

export const TopBackgroundDiv = styled(BaseStyles.Container)`
    background: #292929;
    box-sizing: border-box;
    height: 50%50%;
    width: 100%;
    position: relative;
    z-index: 0;
`

export const BottomBackgroundDiv = styled(BaseStyles.Container)`
    background: #FFFFFF;
    box-sizing: border-box;
    height: 50%;
    width: 100%;
    position: relative;
    z-index: 0;
`


export const BackgroundDiv = styled(BaseStyles.Div)`
    background: #A3CDED
    box-sizing: border-box;
    height: 100%;
    width: 100%;
    position: relative;
    z-index: 0;
`
